import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the first product card using a unique text from the first product
    // We'll use XPath to find the product card containing "Apple iPhone 15 Pro Max"
    const productCardXPath = "//div[contains(@class, 'product-card')]//h3[contains(text(), 'Apple iPhone 15 Pro Max')]";
    await page.waitForSelector(`xpath=${productCardXPath}`, { timeout: 5000 });

    // Find the "Add to Cart" button inside this product card using XPath
    const addToCartBtnXPath = `${productCardXPath}/ancestor::div[contains(@class, 'product-card')]//button[contains(., 'Add to Cart')]`;
    const addToCartBtn = await page.waitForSelector(`xpath=${addToCartBtnXPath}`, { timeout: 5000 });

    // Take screenshot before clicking Add to Cart
    const step2 = path.join(screenshotsDir, 'step_2_before_add_to_cart.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the "Add to Cart" button
    await addToCartBtn.click();

    // Wait for notification to appear (using .notification.success)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    const step3 = path.join(screenshotsDir, 'step_3_after_add_to_cart.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract cart count from the cart counter (should be updated)
    // The cart count is in an element with id="cartCount"
    await page.waitForSelector('#cartCount', { timeout: 5000 });
    const cartCount = await page.$eval('#cartCount', el => el.textContent.trim());

    // Optionally, extract the notification message
    const notificationMsg = await page.$eval('.notification.success', el => el.textContent.trim());

    return {
      success: true,
      action: "Added the first product (Apple iPhone 15 Pro Max) to cart and verified cart count update.",
      extractedData: {
        cartCount,
        notificationMsg
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
